description:
Live streaming 24 jam: https://www.cnnindonesia.com/tv

Gara-gara menangkap seorang santri yang diduga membawa sabu ke pesantren, seorang anggota kepolisian Polres Sampang, Madura, nyaris dikeroyok massa. Warga mengamuk lantaran penangkapan yang dilakukan petugas dinilai tidak wajar.

Emosi massa tak terbendung, usai mendengar informasi penangkapan seorang santri pondok pesantren, Darul Amin desa Subertellor, desa Pandiangan, kecamatan Robatal Sampang, pada Senin malam.

Massa yang mengamuk hendak mengadili polisi penangkap santri, yang diamankan di dalam rumah pengasuh pondok pesantren. Pihak pesantren bahkan mengaku nyaris tidak bisa membendung amukan warga, lantaran penangkapan santri oleh oknum polisi ini, dinilai tidak wajar. Ada kesan seolah santrinya sengaja dijadikan umpan.

Ikuti berita terbaru di tahun 2020 dengan kemasan internasional berbahasa Indonesia, dan jangan ketinggalan breaking news dengan berita terakhir dan live report CNN Indonesia di https://www.cnnindonesia.com/tv dan channel CNN Indonesia di Transvision. 


CNN Indonesia tergabung dalam grup Transmedia. Dalam Transmedia, tergabung juga Trans TV, Trans7, Detikcom, Transvision, CNN Indonesia.com dan CNBC Indonesia. 

